import React from "react";
import { useNavigate } from "react-router-dom";
import GroupData from "./Group";

const ShowData = () => {
    const navigate = useNavigate();
    const data = {
        groupName: "subway",
        Description: "food party",
        paidByName: "you",
        amount: "1000",
        members: [
            { name: "You", amount: "200.00" },
            { name: "Om", amount: "200.00" },
            { name: "Sapna", amount: "200.00" },
            { name: "Shruti", amount: "200.00" },
            { name: "Shivani", amount: "200.00" },
        ],
    };

    return (
        <div className="button-wrapper">
            <GroupData {...data} />
            <button
                className="expense-button"
                onClick={() => {
                    navigate("/AddExpense");
                }}
            >
                Add Expense
            </button>
        </div>
    );
};

export default ShowData;
